import React, {Component} from 'react';
import axios from 'axios';
import './home.css'
import { Jumbotron, Button } from 'reactstrap';
import { Card, CardTitle, CardText, Row, Col } from 'reactstrap';


export default class Search extends Component {
    constructor(props) {
        super(props);

        this.onChangeTodoDescription = this.onChangeTodoDescription.bind(this);
        this.onChangeTodoResponsible = this.onChangeTodoResponsible.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            todo_description: '',
            todo_responsible: '',
            todo_completed: false
        }
    }

    onChangeTodoDescription(e) {
        this.setState({
            todo_description: e.target.value
        });
    }

    onChangeTodoResponsible(e) {
        this.setState({
            todo_responsible: e.target.value
        });
    }

    onChangeTodoPriority(e) {
        this.setState({
            todo_priority: e.target.value
        });
    }

    onSubmit(e) {
        e.preventDefault();

        console.log(`Form submitted:`);
        console.log(`Todo Description: ${this.state.todo_description}`);
        console.log(`Todo Responsible: ${this.state.todo_responsible}`);
        console.log(`Todo Completed: ${this.state.todo_completed}`);

        const newTodo = {
            todo_description: this.state.todo_description,
            todo_responsible: this.state.todo_responsible,
            todo_priority: this.state.todo_priority,
            todo_completed: this.state.todo_completed
        }

        axios.post('http://localhost:4000/todos/add', newTodo)
            .then(res => console.log(res.data));

        this.setState({
            todo_description: '',
            todo_responsible: '',
            todo_priority: '',
            todo_completed: false
        })
    }
    render(){
        return(
            <div className='container'>
                <Jumbotron>
                <h1 className="display-3">Active Tax Services</h1>
                    <p className="lead"><strong>Company name availability checking.</strong></p>
                    <hr className="my-2" />
                    <p> Use the search box below to check if you conrned name is availed</p>
                    <p className="lead">
                    </p>
                </Jumbotron>  
                <br/>
                <div>
                    <Col rm='6'>
                        <form onSubmit={this.onSubmit}>
                        <div className="form-group">
                            <label>Enter Company Name </label>
                            <input  type="text"
                                    className="form-control"
                                    value={this.state.todo_responsible}
                                    onChange={this.onChangeTodoResponsible}
                                />
                        </div>
                        <div className="form-group">
                            <input type="submit" value="Check" className="btn btn-primary" />
                        </div>
                        </form>
                    </Col>
                </div>

            </div>
        )
    }
}
